import React from 'react'

function NavListItem({ nav, onClick , navOnClick }) {

    const closeMenu = () => {
        // Call onClick function passed from parent component
        onClick();
    };
    return (
        <li>
            <a href={nav.link} 
            className={ `${nav.active ? 'active' : undefined}`}
             navOnClick ={() => { navOnClick(nav._id)}}>{nav.name} 
             <i className={nav.iconClass}></i>
             </a>
        </li>
    )
}

export default NavListItem
